class AddUser extends Component{
    render() {
        return (
            < div className="card" >
                <h5>Form</h5>
                <div className="card-body">
                    <form>
                        <label htmlFor="name">Name</label>
                        <input type="text" name="name" id="name" className="form-control" placeholder="name"></input>
                    </form>
                </div>
            </div >
    )
    }
}

export default AddUser;
